"""Exposes a URL that specifies the behaviour of this scalar."""
directive @specifiedBy(
  """The URL that specifies the behaviour of this scalar."""
  url: String!
) on SCALAR

type DictionarySpecification {
  """Дата архивации"""
  archived: Long

  """Идентификатор коллекции справочника"""
  avroId: String

  """Дата создания"""
  created: Long

  """Создатель"""
  creator: String

  """Описание справочника"""
  description: String

  """Форма справочника"""
  form: String

  """Глобальный идентификатор"""
  guid: String

  """Уникальный идентификатор документа"""
  id: ID!

  """Вид справочника (ссылка на справочник, сейчас просто строка)"""
  kind: String

  """Дата модификации как UnixTime (Может требоваться при обновлении)"""
  modified: Long!

  """Кто модифицировал"""
  modifier: String

  """Наименование справочника"""
  name: String

  """Владелец"""
  owner: String

  """Имя схемы документа"""
  schema: String!

  """Тип справочника (иерархический/табличный)"""
  type: String

  """Версия справочника"""
  version: String
}

type DictionarySpecificationPage {
  documents: [DictionarySpecification]!
  expand: String
  filter: ID
  found: String!
  fulltext: String
  order: Long
  page: String!
  perPage: String!
  schema: String!
  total: String!
}

"""Java Long as scalar."""
scalar Long

